column2:
@zachxbt This is fine IMO
People are just jumpy because they have bags, this is a wild environment full of bad actors, you have to be prepared for this kind of stuff to happen

The space is better for your efforts

@th3coll3ct0r @dapp_com @the_x2y2 @ApeStackin @Cryptotrack3 @LooksRareNFT @clerkclirk @0xKaleo @Anthony__Hu @tp_x2y2 @DAPPKOREA @NFTKred A paused airdrop is a fantastic way to keep a crazy high APY for quick claimers (...and the team)
And a side effect a good way to boost token price for people scrambling to buy to stake as they can't claim

But that's me being cynical

@Loopifyyy @mewn21 The new investor cries for endless utility is choking the space. Teams now need to over-promise and over-deliver.

I've got a few things that I buy because I like the artist/art (e.g Hirst) and the discord is people whining that there's no marketing and utility

Like...it's art
